import React from 'react';
import Styles from './about.modules.css';
const Images = () => {

    return (
        <React.Fragment>
            <img
                src="https://zerodha.com/static/images/nithin-kamath.jpg"
                className={`${Styles.images} 
                rounded-circle  
                my-2`}
            />
            <h5>Nithin Kamath</h5>
            <p>Founder, CEO</p>
        </React.Fragment>
    )
}


export default Images;
